import React from "react";
import { Helmet } from "react-helmet";
const Utah = () => {
  return (
    <>
      <Helmet>
        <title>See Benefits and Resource Guides for Home Warranty Services in Utah</title>
        <meta name="description" content="Acclaimed Home Warranty has provided some of the useful resources for people in Utah looking out for home warranty plans. Contact us today for more." />
      </Helmet>
      <div className="home_page">
        {/* start inner banner */}
        <section className="top-image">
          <img src="images/UtahHomeowner.png" alt="inner banner" />
        </section>
        {/* end inner banner */}
        <section className="plans-title"><div class="container text-center mx-900">
          <h1 className="upper">Plans for every home</h1>
          <p className="text-center sub-txt">We want you to feel confident in your home—that’s why we provide a variety of coverage options for different needs. While all of our plans cover a variety of appliances and accessories, you can choose a more extensive option to make sure every item in your home is in good hands.</p>
        </div>
        </section>
      </div>
    </>
  )
};
export default Utah;
